import * as React from 'react';
import PropTypes from 'prop-types';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import {createTheme} from "@mui/material/styles/index";

function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
        <div
            role="tabpanel"
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <Box sx={{ p: 3 }}>
                    <Typography>{children}</Typography>
                </Box>
            )}
        </div>
    );
}

const theme = createTheme({
    palette: {
        primary: {
            main: 'rgba(255, 0, 0, 0)'
        },
        text1:{
            main:'#a7c0cd'
        }
    },
    typography: {
        allVariants: {
            color: "#a7c0cd"
        },
    },
});

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.number.isRequired,
    value: PropTypes.number.isRequired,
};

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

export default function BasicTabs() {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (

        <Box sx={{ width: '100%' }}>
            <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                <Tabs value={value} onChange={handleChange}
                      aria-label="basic tabs example"
                      textColor="main"
                >
                    <Tab label="Dashboard" {...a11yProps(0)} />
                    <Tab label="Cadastro" {...a11yProps(1)} />
                    <Tab label="Negociaçoẽs" {...a11yProps(2)} />
                </Tabs>
            </Box>
            <TabPanel value={value} index={0}>
                Item One
            </TabPanel>
            <TabPanel value={value} index={1}>
                <box>
                    <Tabs value={value} onChange={handleChange} aria-label="basic tabs example2" textColor="main">
                        <Tab label="Criptomoedas" {...a11yProps(3)} />
                        <Tab label="Exchange" {...a11yProps(4)} />
                        <Tab label="Carteira" {...a11yProps(5)} />
                    </Tabs>
                </box>
                <TabPanel value={value} index={3}>
                    Index 3
                </TabPanel>
                <TabPanel value={value} index={4}>
                    Index 4
                </TabPanel>
                <TabPanel value={value} index={5}>
                    Index 5
                </TabPanel>
            </TabPanel>
            <TabPanel value={value} index={2}>
                Item Three
            </TabPanel>
        </Box>
    );
}
